  nmBarang = data;
  cy.log(`Nama Barang = ${nmBarang}`);
});
_Barang.default.getHargaBarang().then(data => {
  hrgBarang = data;
  cy.log(`Harga Barang = ${hrgBarang}`);
});
_Barang.default.clickBarang();
_detailBarang.default.checkNamaBarang().then(data => {
  expect(data.trim()).equal(nmBarang);
});
_detailBarang.default.checkHrgBarang().then(data => {
  expect(data.trim()).equal(hrgBarang);
});
